import React, { useState, useEffect } from "react";
function Movies() {
  const [movies, setMovies] = useState([]);
  useEffect(() => {
    fetch("https://imdb-top-100-movies.p.rapidapi.com/", {
      method: "GET",
      headers: {
        'X-RapidAPI-Key': '189773483emshdf5c2b3eaeea748p1e6fe0jsnaf1dd42e45d5',
		'X-RapidAPI-Host': 'imdb-top-100-movies.p.rapidapi.com'
      },
    })
      .then((response) => response.json())
      .then((data) => {
        setMovies(data);
        console.log(data);
        console.log(movies)
      })
      .catch((error) => console.log(error));
  }, [movies]);

  return (
    <div>
      <ul>
      {movies.map((movie) => (
        <li key={movie.id}>
            {movie.title} {movie.description} {movie.rank} {movie.image}
        </li>
        ))}

      </ul>
    </div>
  );
}
export default Movies;
